import Main from "../src/components/Main";
<link href="https://unpkg.com/aos@2.3.1/dist/aos.css" rel="stylesheet"></link>


const Index = () => {
  return (
      <div>
          <Nav/>
          <Main/>
      </div>
  );
};

export default Index;
